--
-- Table structure for table `visita_specialistica`
--

DROP TABLE IF EXISTS `visita_specialistica`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `visita_specialistica` (
  `id_prescrizione` int(11) NOT NULL,
  `id_medico_specialista` int(11) DEFAULT NULL,
  `id_ticket` int(11) DEFAULT NULL,
  `id_visita_spec` int(11) DEFAULT NULL,
  `anamnesi` text DEFAULT NULL,
  `cura` text DEFAULT NULL,
  `time_visita` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_prescrizione`),
  UNIQUE KEY `time_visita` (`time_visita`),
  KEY `fk_visita_specialistica_to_utenti` (`id_medico_specialista`),
  KEY `fk_visita_specialistica_to_ticket` (`id_ticket`),
  KEY `fk_visita_specialistica_to_visite` (`id_visita_spec`),
  CONSTRAINT `fk_visita_specialistica_to_prescrizione` FOREIGN KEY (`id_prescrizione`) REFERENCES `prescrizione` (`id`),
  CONSTRAINT `fk_visita_specialistica_to_ticket` FOREIGN KEY (`id_ticket`) REFERENCES `ticket` (`id`),
  CONSTRAINT `fk_visita_specialistica_to_utenti` FOREIGN KEY (`id_medico_specialista`) REFERENCES `utenti` (`id`),
